import React, { useState } from 'react';
import { Navbar, Nav, Container, Image } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import Logo from './Logo';
import { GoogleLogin, googleLogout } from '@react-oauth/google';

function NavigationBar({ theme, toggleTheme }) {
  const [user, setUser] = useState(null);

  return (
    <Navbar fixed="top" expand="lg" className="custom-navbar shadow-sm" style={{ background: '#fff' }}>
      <Container>
        <Navbar.Brand as={Link} to="/" className="d-flex align-items-center gap-2">
          <Logo size={32} />
          <span className="brand-text">PixelPress</span>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="main-navbar-nav" />
        <Navbar.Collapse id="main-navbar-nav">
          <Nav className="ms-auto align-items-center gap-2">
            <Nav.Link as={Link} to="/compress" className="nav-link-custom">Compress Image</Nav.Link>
            <Nav.Link as={Link} to="/about" className="nav-link-custom">About Us</Nav.Link>
            <Nav.Link as={Link} to="/contact" className="nav-link-custom">Contact</Nav.Link>
            <button
              className="theme-toggle-btn btn btn-link"
              onClick={toggleTheme}
              aria-label="Toggle dark/light mode"
              style={{ fontSize: 22 }}
            >
              {theme === 'dark' ? (
                <span role="img" aria-label="Light mode">ðŸŒž</span>
              ) : (
                <span role="img" aria-label="Dark mode">ðŸŒ™</span>
              )}
            </button>
            {!user ? (
              <GoogleLogin
                onSuccess={credentialResponse => {
                  setUser(credentialResponse);
                }}
                onError={() => {
                  alert('Login Failed');
                }}
                size="medium"
                shape="circle"
              />
            ) : (
              <>
                <Image src="https://ui-avatars.com/api/?name=User" roundedCircle width={36} height={36} alt="Profile" />
                <button
                  className="btn btn-link"
                  onClick={() => {
                    googleLogout();
                    setUser(null);
                  }}
                >
                  Logout
                </button>
              </>
            )}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavigationBar;
